import React,{ Component } from "react";

class ListCodeItem extends Component{
    constructor(props){
        super(props);
        this.state ={
            "id" : props.id,
            "title" : props.title
        };
    }

    render() {
        const { id, title } = this.state;
        return (
          <li>
            <a href={`/CodePage/${id}`}>{title}</a>
          </li>
        );
      }
}

export default ListCodeItem;
